import React, { useEffect, useState } from "react";
import "../App.css";
import data from "../data/data.json";
import axios from "axios";

const Add = ({ changeView }) => {
  const [name, setName] = useState("");
  const [CT, setCT] = useState("");
  const [PT, setPT] = useState("");
  const [serves, setServes] = useState("");
  const [category, setCategory] = useState("");
  const [desc, setDes] = useState("");
  const [Ingredients, setIngredeints] = useState("");
  const [url, setURL] = useState("");

  const a = {
    Cook_Time: CT,
    Prep_Time: PT,
    recepie_Name: name,
    Serves: serves,
    categorie: category,
    recepie_Image: url,
    recepie_Description: desc,
    recepie_Ingredients: Ingredients,
    users_user_Id: 1,
  };
  const obj = {
    recepie_Id: 6,
    Cook_Time: 15,
    Prep_Time: 10,
    recepie_Name: "Spaghetti Carbonara",
    Serves: 2,
    categorie: "dinner",
    recepie_Image:
      "https://images.unsplash.com/photo-1546549032-9571cd6b27df?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxzZWFyY2h8NHx8U3BhZ2hldHRpJTIwQ2FyYm9uYXJhfGVufDB8fDB8fA%3D%3D&auto=format&fit=crop&w=500&q=60",
    recepie_Description:
      "Spaghetti Carbonara is a classic Italian dish made with spaghetti, eggs, pancetta, and cheese. The sauce is made by combining raw eggs with hot pasta to create a creamy, rich coating. It's a quick and easy meal that's perfect for a weeknight dinner.",
    recepie_Ingredients:
      "8 oz spaghetti,2 large eggs,1/2 cup grated Parmesan cheese,4 slices bacon, 2 cloves garlic, minced Sat and pepper",
    users_user_Id: 1,
  };

  useEffect(() => {
    axios
      .post("http://localhost:5000/recepie", obj)
      .then((res) => {
        console.log(obj);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  return (
    <div className="add-recipe-form ">
      <div className="form-group">
        <label>Name:</label>
        <input
          type="text"
          placeholder="Name"
          onChange={(e) => setName(e.target.value)}
        />
      </div>
      <div className="form-group">
        <label>Cook Time:</label>
        <input
          type="number"
          placeholder="Cooking Time"
          onChange={(e) => setCT(e.target.value)}
        />
      </div>
      <div className="form-group">
        <label>Prep Time:</label>
        <input
          type="number"
          placeholder="Preparation Time"
          onChange={(e) => setPT(e.target.value)}
        />
      </div>
      <div className="form-group">
        <label>Serves:</label>
        <input
          type="number"
          placeholder="serves"
          onChange={(e) => setServes(e.target.value)}
        />
      </div>
      <div className="form-group">
        <label>Category:</label>
        <input
          type="text"
          placeholder="Category"
          onChange={(e) => setCategory(e.target.value)}
        />
      </div>
      <div className="form-group">
        <label>Description:</label>
        <input
          type="text"
          placeholder="Description"
          onChange={(e) => setDes(e.target.value)}
        />
      </div>
      <div className="form-group">
        <label>Ingredients:</label>
        <input
          placeholder="Ingredients"
          onChange={(e) => setIngredeints(e.target.value)}
        />
      </div>

      <div className="form-group">
        <label>Image:</label>
        <input
          type="text"
          placeholder="Image URL"
          onChange={(e) => setURL(e.target.value)}
        />
      </div>
      <button
        className="create-recipe-btn"
        onClick={() => changeView("Allrecepies")}
      >
        Create Recipe
      </button>
    </div>
  );
};
export default Add;
